DROP TABLE IF EXISTS `#__redjuvenil_data`;
CREATE TABLE IF NOT EXISTS `#__redjuvenil_data` (
 `id` INT NOT NULL AUTO_INCREMENT,
 `regional` VARCHAR(255) DEFAULT NULL,
 `departamento` VARCHAR(100) DEFAULT NULL,
 `ciudad` VARCHAR(200) DEFAULT NULL,
 `tipo_identificacion` VARCHAR(2) DEFAULT NULL,
 `numero_identificacion` VARCHAR(20) DEFAULT NULL,
 `razon_social` VARCHAR(255) DEFAULT NULL,
 `nombre_comercial` VARCHAR(500) DEFAULT NULL,
 `especialidad` VARCHAR(255) DEFAULT NULL,
 `categoria` VARCHAR(255) DEFAULT NULL,
 `servicio` VARCHAR(255) DEFAULT NULL,
 `direccion` VARCHAR(255) DEFAULT NULL,
 `complemento_direccion` VARCHAR(500) DEFAULT NULL,
 `institucion` VARCHAR(255) DEFAULT NULL,
 `telefono` VARCHAR(500) DEFAULT NULL,
 `correo` LONGTEXT,
 `sede_propia` VARCHAR(2) DEFAULT NULL,
 `fecha` VARCHAR(10) DEFAULT NULL,
 PRIMARY KEY(`id`)
)ENGINE=MyISAM DEFAULT CHARSET='UTF8';


